import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import * as React from "react";

import MDBox from "../components/MD/MDBox";
import MDTypography from "../components/MD/MDTypography";
import DataTable from "../components/DataTable";
import { useState } from "react";
import MDButton from "../components/MD/MDButton";
import { CircularProgress } from "@mui/material";
import EditIcon from "@mui/icons-material/Edit";
import DeleteIcon from "@mui/icons-material/Delete";
import Checkbox from "@mui/material/Checkbox";

import "./LandingPage/css/animate.css";
import "./LandingPage/css/bootstrap.min.css";
import "./LandingPage/css/default.css";
import "./LandingPage/css/lineicons.css";
import "./LandingPage/css/style.css";
import "./LandingPage/css/style.css.map";

const tableColumns = [
  { Header: "", accessor: "checkbox", width: "10%", align: "left" },
  { Header: "Id", accessor: "id", width: "10%", align: "left" },
  { Header: "Name", accessor: "name", align: "left" },
  { Header: "MatomoId", accessor: "matomoId", width: "60%", align: "left" },
  { Header: "Actions", accessor: "actions", align: "left" },
];

const Upload = () => {
  const [file, setFile] = useState("");
  const [array, setArray] = useState([]);
  const [users, setUsers] = useState([]);
  const [checked, setChecked] = useState(false);

  const fileReader = new FileReader();

  const handleOnChange = (e) => {
    setFile(e.target.files[0]);
  };

  const createTableRows = (users) => {
    return users.map((user) => ({
      checkbox: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          <Checkbox onClick={() => handleChecked(user.id)} />
        </MDTypography>
      ),
      id: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          {user.id}
        </MDTypography>
      ),
      name: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          {user.name}
        </MDTypography>
      ),
      matomoId: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          {user.matomoId}
        </MDTypography>
      ),
      actions: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          <MDButton
            className="btn btn-primary btn-just-icon"
            color="info"
            onClick={() => handleEdit(user.id, user.name)}
          >
            <EditIcon />
          </MDButton>
          <MDButton
            className="btn btn-primary btn-just-icon"
            color="info"
            onClick={() => handleDelete(user.id)}
          >
            <DeleteIcon />
          </MDButton>
        </MDTypography>
      ),
    }));
  };

  const csvFileToArray = (string) => {
    const csvHeader = string.slice(0, string.indexOf("\n")).split(",");
    const csvRows = string.slice(string.indexOf("\n") + 1).split("\n");

    const array = csvRows.map((i) => {
      const values = i.split(",");
      const obj = csvHeader.reduce((object, header, index) => {
        object[header] = values[index];
        return object;
      }, {});
      return obj;
    });

    setArray(array);
  };

  const handleOnSubmit = (e) => {
    e.preventDefault();

    if (file) {
      fileReader.onload = function (event) {
        const text = event.target.result;
        csvFileToArray(text);
      };
      fileReader.readAsText(file);
    }

    const formData = new FormData();
    formData.append("file", file);
    const headers = {
      "Content-Type": "multipart/form-data",
    };
    console.log(formData);

    fetch("http://localhost:5000/upload", {
      method: "POST",
      body: formData,
    })
      .then((res) => console.log(res))
      .catch((err) => console.warn(err));
  };

  const handleChecked = (id) => {
    if (!checked.includes(id)) {
      setChecked((checked) => [...checked, id]);
    } else {
      const updatedArr = [...checked];
      const idx = updatedArr.findIndex((elm) => elm === id);
      updatedArr.splice(idx, 1);

      setChecked(updatedArr);
    }
  };

  const handleEdit = (id, name) => {
    setOpen(true);
    setText(name);
    setmatomoId(id);
    setAction({ action: "edit", id: id });
  };

  const handleDelete = (id) => {
    deleteAllSites(id)
      .catch((err) => console.log(err))
      .finally(() => {
        setLoading(false);
      });
  };
  const handleClickOpen = () => {
    setOpen(true);
    setAction({ action: "add", id: -1 });
  };

  const handleClose = () => {
    setOpen(false);
    setText("");
    setmatomoId(null);
  };
  return (
    <div>
      <div>
        <div className="header-shape-1"></div>
        <header className="header-area ">
          <div
            id="home"
            className="header-hero bg_cover d-lg-flex align-items-center"
          >
            <div className="shape shape-1"></div>
            <div className="shape shape-2"></div>
            <div className="shape shape-3"></div>
            <div className="shape shape-4"></div>
            <div className="shape shape-5"></div>
            <div className="shape shape-6"></div>

            <div className="container">
              <Card variant="outlined">
                <form>
                  <input
                    type={"file"}
                    id={"csvFileInput"}
                    accept={".csv"}
                    onChange={handleOnChange}
                  />

                  <button
                    onClick={(e) => {
                      handleOnSubmit(e);
                    }}
                  >
                    IMPORT CSV
                  </button>
                </form>
              </Card>

              <MDBox pt={6} pb={3}>
                <Grid container spacing={6}>
                  <Grid item xs={12}>
                    <Card>
                      <MDBox
                        mx={2}
                        mt={-3}
                        py={3}
                        px={2}
                        variant="gradient"
                        bgColor="info"
                        borderRadius="lg"
                        coloredShadow="info"
                      >
                        <MDTypography variant="h6" color="white">
                          Users List
                          {checked.length > 0 && (
                            <MDButton
                              className="btn btn-primary btn-just-icon"
                              color="info"
                              style={{ float: "right" }}
                            >
                              <DeleteIcon />
                            </MDButton>
                          )}
                        </MDTypography>
                      </MDBox>
                      <MDBox pt={3}>
                        <DataTable
                          table={{
                            columns: tableColumns,
                            rows: createTableRows(users),
                          }}
                          isSorted={false}
                          entriesPerPage={false}
                          showTotalEntries={false}
                          noEndBorder
                        />
                      </MDBox>
                    </Card>
                  </Grid>
                </Grid>
              </MDBox>
            </div>
          </div>
        </header>
      </div>
    </div>
  );
};

export default Upload;
